import React from "react";

const ImageView = (props) => {
  return (
    <div>
      <img
        src={props.location.state.image.largeImageURL}
        alt={props.location.state.image.id}
      />
      <p>&copy;pixabay</p>
      <h4>Credit: {props.location.state.image.owner}</h4>
    </div>
  );
};

export default ImageView;
